description:
Le réseau de chauffage urbain est un système de distribution de chaleur produite de façon centralisée qui véhicule de l'eau surchauffée à travers la ville. Il permet de fournir l’énergie nécessaire au chauffage et à l’eau chaude sanitaire des grands ensembles urbains, qu’il s’agisse d’hôpitaux, écoles, logements collectifs, d’immeubles de bureaux, de sites tertiaires et industriels.
Le réseau de froid urbain, contrairement au réseau de chaleur, transporte de l’eau glacée et permet la climatisation des bâtiments raccordés.&nbsp;
Ce jeu de données décrit le linéaire des canalisations de chauffage et de froid urbain, avec le type de réseau, le type de fluide transporté et le sens de parcours.

Comme le précise la circulaire du 16 janvier 2020 sur le déroulement des opérations électorales, dès l'ouverture de la campagne électorale officielle, les communes doivent installer des panneaux électoraux aux abords des bureaux de vote.
Le nombre maximum de ces emplacements est fixé en fonction du nombre d'électeurs des communes :
    - cinq emplacements dans les communes de moins de 500 électeurs ;
    - dix emplacements dans les communes ayant entre 501 et 5 000 électeurs ;
    - dix emplacements et plus pour les plus grandes communes (en proportion du nombre d'électeurs).

